let framekits = parcel.getFeatureById('framekits')

let a1 = framekits.createAnimation('position')

a1.setKeys([
  {
    frame: 0,
    value: framekits.position
  },
  {
    frame: 30,
    value: framekits.position.add(new Vector3(1, 0, 0))
  },
  {
    frame: 60,
    value: framekits.position
  }
])

let a2 = framekits.createAnimation('position')

a2.setKeys([
  {
    frame: 0,
    value: framkits.position
  },
  {
    frame: 30,
    value: framekits.position.add(new Vector3(-1, 0, 0))
  },
  {
    frame: 60,
    value: framekits.position
  }
])

let framekits = parcel.getFeatureById('framekits');

let a1 = framekits.createAnimation('position');
let a2 = framekits.createAnimation('position');

a1.setKeys([
  {
    frame: 0,
    value: framekits.position
  },
  {
    frame: 120,
    value: framekits.position.add(new Vector3(0, 0, -3.4))
  },
  {
    frame: 920,
    value: framekits.position
  }
]);

a2.setKeys([
  {
    frame: 0,
    value: framekits.position
  },
  {
    frame: 60,
    value: framekits.position.add(new Vector3(0, 0, 3))
  },
  {
    frame: 520,
    value: framekits.position
  }
]);

feature.on('click', e => {
  if (framekits.position.z == framekits.position.z) {
    framekits.startAnimations([a1]);
  } else {
    framekits.startAnimations([a2]);
  }
});

